import React from 'react';

function Home() {
  return (

    <div>
      <header id="masthead" class="site-header">
        <nav id="primary-navigation" class="site-navigation">
            <div class="container">



            </div>   
        </nav>
    </header>

    <div id="hero" class="hero overlay">
        <div class="hero-content">
            <div class="hero-text">
                <h1>Welcome To GitHub Issue Page</h1>
                <p>For Redirecting to Issue Page you need to do Registration</p>
                <a href="#" class="btn btn-border">Registration</a>
            </div>
        </div>
    </div>

    </div>


  ) ;
}

export default Home;
